        newa(sette)


    }


    return (
        <div className='expenses'>
            <ExpensesFilter  selected = {prev} orfun ={orfun} />

            {props.mame.map(myspense => <Myname 
            title = {myspense.title}
            amount = {myspense.amount}
            date = {myspense.date}
            />)}
            
        </div>
    )
}
export default Expenses;
